import React from 'react'
import styles from './CandidateBar.module.css'

const CandidateBar = (props) => {
  return (
    <div className={styles.candidateBar}>
      <span className={styles.candidateImage}>Candidate Image</span>
      <span className={styles.candidateName}>Candidate Address</span>
      <button className={styles.yes}>Vote Yes</button>
      <button className={styles.no}>Vote No</button>
    </div>
  )
}

export default CandidateBar
